import './app-header.css';
import styledx from "styled-components";

const Header = styled.div`
  display: flex;

`

const AppHeader = () => {
  return (
      <div className="app-header d-flex">
        <h1>Stepa Dudar</h1>
        <br/><br/>
        <h2>5 posts, 0 likes</h2>
      </div>
  )
};

export default AppHeader;
